}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 24 24" xml:space="preserve"><path class="aw-theme-iconOutline" fill="#464646" d="M21,14c0,5-4,9-9,9s-9-4-9-9s4-9,9-9h4.3l-2.6,2.6l0.7,0.7l3.9-3.9l-3.9-3.9l-0.7,0.7L16.3,4H12	C6.5,4,2,8.5,2,14s4.5,10,10,10s10-4.5,10-10H21z"/></svg>';
